Data citation is recognised as one of the key practices underpinning the recognition of data as a primary research output rather than as a by-product of research. 
This Roundtable is aimed at those who wish to learn about, and contribute to, best practices for Data Citation for the Australian research community.  
The roundtable format will have an emphasis on discussion and sharing. Those who come along will walk away with a strong understanding of the benefits as well as practical and technical facets of implementing data citation.
When? 9:00am-3.00pm on Thursday 9 August 2012
 Where? Level 7, Webb Centre (Bldg S02), Griffith University, South Bank Campus, 226 Grey Street, South Bank, Brisbane (Behind the Ship Inn)
Program
Partners are welcome to attend the whole day or choose to attend selected sessions only - please register for the whole day.
Please share this invitation with colleagues who may be interested in attending.
9.00    Why is Data Citation such a hot topic?What’s in it for institutions and researchers? Metrics for strategic planning. National and international perspectives
10.30   Morning Tea
10.45   Technical considerationsMinting DOIs using Cite My Data. When do I DOI? Making the most of optional DataCite metadata elements. Thomson Reuters Data Citation Index. Gold Standard Records and Cite-able records.
11.45   Policy implicationsPolicies – examples. Workflows. Citation and data aggregators
12.30 Lunch
1.00   Engaging with researchers and library staff (culture changing)Beginning the Data Citation journey. Winning hearts'n'minds with both sticks and carrot. Data Interviews
2.00 The Australian Data Citation Roundtable communityPromoting and populating Best practice examples.Keystones and lodestones but no millstones. Furthering the culture of Australian Data Citation Best Practice
3.00 Close
Directions and Parking
